import React from "react";

const BookCard = ({ book }) => (
  <div style={{
    border: "1px solid #ccc",
    borderRadius: "8px",
    padding: "1rem",
    marginBottom: "1rem",
    background: "#fafafa"
  }}>
    <h3>{book.title}</h3>
    <p><strong>Author:</strong> {book.author}</p>
    <p>{book.description}</p>
  </div>
);

export default BookCard;
